r($,"aD4","aeV",()=>A.a([A.vL("The Meal Monkey app for Android is a food delivery service. This app has all of the capabilities of a modern food delivery service. The authentication is handled using Kotlin and Firebase, while the database is handled by SQL.","Meal Monkey - Food Delivery Application","https://github.com/ManjunathNayak-23/MealMonkey"),A.vL("The College Management System is an android app that is useful for students as well as college faculty members and other academic staff. The major goal of using the College Management System is to make it easier to manage the Institute. Students can get the latest notices directly into the app in real-time, check for the latest upcoming events in the college, and track the college bus location in real-time, students can also store their important notes in the app itself, students can directly receive placement notification in-app when updated by placement officer, students can also save their schedule day by day, and they can even share ideas to improve the app.","University Management System","https://github.com/ManjunathNayak-23/University-Management-System"),A.vL("simply ecommerce is an dress shoppie application. It has modern Ui design and everthing online based experience to the user. It also consist of chatbot in the application so that it can solve users queries. It consist of all the features a modern ecommerce application hosts. This android application is developed using java and for the backend services it makes use of firebase realtime database.","Simply Ecommerce","https://github.com/ManjunathNayak-23/Simply-Ecommerce"),A.vL("This is a Notes App with a lovely Ui / Ux that can be used in everyday life. It also has a feature that allows you to sync all of your notes in the cloud while you're on the go. The notes can then be used on several devices. The app is connected to a safe Firebase backend. This also contains a Speech to Text Conversion Mechanism that will make y\u2026","FireNotes - A cloud based notes app","https://github.com/ManjunathNayak-23/NotesApp"),A.vL("The Multi Lingual Chat app is a modern chat application that allows users to translate text\xa0messages into their preferred language. This\xa0application now supports the following languages: telugu, hindi, kannada, and English.","MultiLingual Chat App","https://github.com/ManjunathNayak-23/MultiLingual-chat-app"),A.vL("DareToDonate application provides a reliable platform to connect local blood donors with patients. DareToDonate creates a communication channel through authenticated clinics whenever a patient needs blood donation. It is a useful tool to find compatible blood donors who can receive blood request posts in their local area. Clinics can use this web application to maintain the blood donation activity.","Blood Donation - Dare To Donate","https://github.com/ManjunathNayak-23/BloodDonation-DareToDonate")],A.O("p<FE>")))
